import React from 'react'
import TextField from 'material-ui/TextField';
import PropTypes from "prop-types";
import { withStyles } from '@material-ui/core/styles';
import { usStates } from '../../dataLists'

const styles = theme => ({
  container: {
    display: 'flex',
    flexWrap: 'wrap',
  },
  textField: {
    marginLeft: theme.spacing.unit,
    marginRight: theme.spacing.unit,
    width: 200,
  },
  button: {
    display: 'block',
    marginTop: theme.spacing.unit * 2,
  },
  formControl: {
    margin: theme.spacing.unit,
    minWidth: 120,
  }
});


class RecipientsAddress extends React.Component {


  render(){
    const { classes, page2, handleChange, mainState } = this.props
    const usStates= usStates()
    return (
        <React.Fragment>
          {page2.map(dataObj =>
            { const name1 = dataObj.name
              return (
                < React.Fragment>
                  <TextField
                  hintText="Please type..."
                  floatingLabelText={dataObj.label}
                  onChange={handleChange}
                  data-category={dataObj.category}
                  defaultValue={mainState[name1]}
                  name={name1}
                  />
                  < br />
                < /React.Fragment>
              )

            }
          )}
          < br />

        </React.Fragment>

    )
   }
  }
  RecipientsAddress.propTypes = {
    classes: PropTypes.object.isRequired,
  };

export default withStyles(styles)(RecipientsAddress)
